import { Link } from 'react-router-dom';
import './Navbar.css'


function Navbar() {
    return (
        <nav>
            <div className='container-name navbar'>
                <Link to="/" class="logo"><h1 className='name'>Em</h1></Link>
                <input type="checkbox" id="toggler"></input>
                <label for="toggler"><i class="fa-solid fa-bars"></i></label>
            </div>
            <div className='container-navbar menu'>
                <ul className='list'>
                <Link to="/" className='item'>Home</Link>
                <Link to="/aboutme" className='item'>Perfil</Link>
                <Link to="/skills" className='item'>Habilidades</Link>
                <Link to="/studies" className='item'>Estudios</Link>
                </ul>
            </div>
               
            </nav>
    );
}

export default Navbar;
